abort-1-test (node : class benchmark-node)

begin
  {Simple procedure abort.}

  start abort-1-test-helper () at priority 2;
  wait for 1 second;
  abort abort-1-test-helper;
  wait for 1 second;
  conclude that abort-1-loop-status is should-be-stopped;
  wait for 1 second;

  if abort-1-loop-status is should-be-stopped 
  then call pass (node)
  else call fail (node, "Failed to stop looping.");
end

abort-1-test-helper ()
begin
    {loop forever--will be aborted by invoker}
    repeat 
        conclude that abort-1-loop-status is still-looping;
        wait for 1 second; 
    end
end

abort-2-test-helper ()
begin
    {loop forever--will be aborted by invoker}
    repeat 
        conclude that abort-2-loop-status is still-looping;
        allow other processing; 
    end
end

abort-2-test (node : class benchmark-node)

begin
  {Start low priority procedure and then abort it before it may have actually started, without waiting for it to start.}

  start abort-2-test-helper () at priority 9;
  {Don't wait here -- testing race condition.}
  abort abort-2-test-helper;
  conclude that abort-2-loop-status is should-be-stopped;
  wait for 2 seconds;

  if abort-2-loop-status is should-be-stopped 
  then call pass (node)
  else call fail (node, "Failed to stop looping");
end

abort-3-test (node : class benchmark-node)

begin
  {Aborts a waiting task}

  start abort-3-test-helper ();
  conclude that abort-3-param is preset-value;
  wait for 1 second;
  abort abort-3-test-helper;

  wait for 1 second;

  if abort-3-param is preset-value
  then call pass (node)
  else call fail (node, "Error condition incorrectly evaluated.");
end

abort-3-test-helper ()
error-type: symbol;
error-text: text;

begin
   wait for 1 week;
end 
on error (error-type, error-text)
   conclude that abort-3-param is caught-error;
end

abort-4-test-helper ()
pi: class procedure-invocation;

begin

    {pass pi back to caller via relation:}
    pi = this procedure-invocation;
    conclude that pi is the-abort-4-procedure-invocation-of this procedure;

    {Enter infinite loop -- caller will abort it} 
    repeat
        allow other processing;
        conclude that abort-4-test-param is still-looping;
    end;
end

abort-4-test (node : class benchmark-node)
helper-status: symbol;
tries-to-abort: integer;
abort-succeeded: truth-value;

begin
    start abort-4-test-helper ();

    { jh per bah, 6/29/92.  Added repeated tries for the sake of slow machines like the Masscomp.  If even a slow machine can't find the procedure invocation after 5 tries, we have a real problem. }
    for tries-to-abort = 1 to 5 do
      wait for 1 second;
      if the procedure-invocation that is the-abort-4-procedure-invocation-of abort-4-test-helper exists then 
        begin
          abort the procedure-invocation that is the-abort-4-procedure-invocation-of abort-4-test-helper;
          conclude that abort-4-test-param is stopped;
          wait for 1 second;
        end; { if the procedure-invocation exists }
    end; { 5 tries-to-abort }

    if abort-4-test-param is stopped 
        then call pass (node)
        else call fail (node, "Invocation not aborted.");
end

abort-5-test (node : class benchmark-node)

begin
  {test self aborting procedure}

  start abort-5-test-helper ();
  wait for 2 seconds;
  if abort-5-loop-status is not error-while-aborting then
  begin
    conclude that abort-5-loop-status is should-be-stopped;
    wait for 2 seconds;
  end;

  if abort-5-loop-status is should-be-stopped 
  then call pass (node)
  else call fail (node, "Failed to abort properly.");
end

abort-5-test-helper ()
sym: symbol;
txt: text;

begin

    repeat 
        conclude that abort-5-loop-status is still-looping;
        allow other processing;
        begin
            abort this procedure-invocation;
        end on error (sym, txt)
            conclude that abort-5-loop-status is error-while-aborting;
            return;
        end;
    end
end

wait-until-1-test (node : class benchmark-node)
error-status: symbol = the symbol awaiting-grammar;

begin
  conclude that wait-until-1-status is preset-value;
  start wait-until-helper ();
  wait for 1 second;
  if wait-until-1-status is not preset-value then error-status = the symbol failed-did-not-wait
  else begin
    conclude that wait-until-1-control is proceed;
    wait for 1 second;
    if wait-until-1-status is not procedure-concluded 
      then error-status = the symbol failed-did-not-proceed
      else error-status = the symbol ok;
    end;

  if error-status is ok then call pass (node)

  else if error-status is failed-did-not-wait 
  then call fail (node, "Failed to wait.")

  else if error-status is failed-did-not-proceed 
  then call fail (node, "Failed to proceed.")

  else call fail (node, "Awaiting grammar, code: [error-status]");
end

wait-until-helper ()
begin
    wait until wait-until-1-control receives a value;
    conclude that wait-until-1-status is procedure-concluded;
end

