cloning-1-test (node : class benchmark-node)
frb2, frb3: class cloning-fribble;

begin
  {Clone item, then clone the clone.}
  create a cloning-fribble FRB2 by cloning cloning-fribble-1;
  transfer FRB2 to the subworkspace of cloning-1 at (0, 0);

  create a cloning-fribble FRB3 by cloning FRB2;
  transfer FRB3 to the subworkspace of cloning-1 at (5.0, 3.0);

  if the flavor of FRB2 is not chocolate-almond 
  then 
  begin
     if FRB2 exists then delete FRB2;
    call fail (node, "Failed to clone attribute.")
  end
  else if FRB3 is not a cloning-fribble
  then 
  begin
    if FRB3 exists then delete FRB3;
    call fail (node, "Failed to clone transient obj.")
  end
  else 
  begin
    if FRB2 exists then delete FRB2;
    if FRB3 exists then delete FRB3;
    call pass (node);
  end
end

