make-permanent-1-test (node : class benchmark-node)
kbws: class kb-workspace;
cp1: class connection-post;

begin
  {Test make permanent & make transient}

  create a kb-workspace KBWS;
  create a connection-post CP1;
  make KBWS the subworkspace of make-permanent-1-test;

  {Critical section here.  If crashes between making the workspace permanent and later making it transient, this test will be permanently changed.  Someday when ON EXIT is provided, a bit more insurance can be provided.  Running at high priority to help ensure no problems in critical code here.}
  make KBWS permanent;

  transfer CP1 to the subworkspace of make-permanent-1-test;
  make CP1 permanent;
  make CP1 transient;
  make CP1 permanent; {will still go-away when RESET}
  make KBWS transient;
  delete KBWS;
  call pass (node);
end

