activation-1-test (node : class benchmark-node)
kbws: class kb-workspace;
R: class rule;

begin
  {Clone a rule onto an activatable subWS and activate the WS.  Test that rule fires.}

  create a kb-workspace KBWS;
  make KBWS the subworkspace of activation-1-post;

  create a rule R;
  transfer R to KBWS;
  change the text of R to "unconditionally conclude that activation-1-parameter is initialization-succeeded";
  change the text of the categories of R to "activation-1-category";

  {Preset value, then activate and compare}
  conclude that activation-1-parameter is preset;
  activate the subworkspace of activation-1-post;
  invoke activation-1-category rules;
  do in parallel until one completes 
    wait until activation-1-parameter is not preset checking every 1 second;
    wait for 30 seconds;
  end;
  if activation-1-parameter is initialization-succeeded
  then call pass (node)
  else call fail (node, "Activation failed to enable rule");

  delete R;
  delete KBWS;
end

