text-values-4-test (node : class benchmark-node)
qty: quantity;
result: symbol = the symbol ok;

begin
  {Change update interval.  Initially should timeout due to no update interval}

  collect data ( timing out after 2 seconds)
    qty = the current value of text-values-4-var;
    if timeout then result = the symbol timeout;
  end;

  if result is not timeout then
  begin
    call fail (node, "unexpectedly found a current value for test var");
    return;
  end;

 change the text of the default-update-interval of text-values-4-var to "1 second";  

  {Now repeat, but this time should have a result}
  wait for 1 second;
  collect data ( timing out after 2 seconds)
    qty = the current value of text-values-4-var;
    if timeout then result = the symbol failed;
  end; 

  {cleanup}
  change the text of the default-update-interval of text-values-4-var to "none";
  conclude that text-values-4-var has no current value;

  if result is failed
    then call fail (node, "failed to find a current value after establishing an update interval")
    else call pass (node);
end

text-values-5-test (node : class benchmark-node)
v1, v2: integer;
int: class integer-variable = the integer-variable upon the subworkspace of text-values-5;
err-sym: symbol;
err-txt: text;

begin
  {Change the name of a variable and verify that its indirect use is affected.}

  change the name of text-values-5-var to the symbol text-values-5-var-moniker;
  conclude that text-values-5-var-name is text-values-5-var-moniker;

  {Expect reference via previous name to fail and via new name to succeed}

  collect data ( timing out after 1 second)
    v1 = the value of the integer-variable named by text-values-5-var-name;
    if timeout then v1 = -1;
  end;

  {the collection actually will error-out since text-values-5-var will no longer exist here!  Hence the on-error}
  begin
    collect data (timing out after 1 second)
      v2 = the value of text-values-5-var;
      if timeout then v2 = -1;
    end; 
  end on error (err-sym, err-txt)
    v2 = -1;
  end;

  {cleanup}
  change the name of int to the symbol text-values-5-var;

  if v1 /= -1 and v2 = -1
  then call pass (node)
  else call fail (node, "Indirect through renamed var failed");
end

