history-1-test (node : class benchmark-node)
flt: float = 12.34;
num1, num2: integer;

begin
  {Test number of points.}
  {NOTE THAT THIS TEST IS INCONSISTENT FROM TIME TO TIME.  USUALLY IT SUCCEEDS, BUT NOT ALWAYS.  THERE MUST BE SOME RACE CONDITION SOMEWHERE.}

  call history-1-helper-1 ();
  change the text of the default-update-interval of history-1-var-2 to "1 second";
  wait for 3 seconds;
  change the text of the default-update-interval of history-1-var-2 to "none";

  num1 = the number of history datapoints in history-1-var-1 between 1 hour ago and 1 second ago;
  num2 = the number of history datapoints in history-1-var-2 during the last 5 weeks;
  {** modified the following to also test for num2=3, since the above test can add 3 or 4 values to the history depending on if there is time to update the variable in the current clock tick before waiting for 3 seconds.
  - cpm, 12/6/91}
  if num1 = 1 and (num2 = 4 or num2 = 3)
  then call pass (node)
  else call fail (node, "number-of-items-in-history were [num1] and [num2].");

 {Clear the history, in case the test is called multiple times.  - cpm, 2/26/92}
  change the text of the history-keeping-spec of HISTORY-1-VAR-2 to "do not keep history";
  change the text of the history-keeping-spec of history-1-var-2 to "keep history with maximum age of data points = 1 week";
 change the text of the history-keeping-spec of HISTORY-1-VAR-1 to "do not keep history";
  change the text of the history-keeping-spec of history-1-var-1 to "keep history with maximum number of data points = 10";
end

