  {Iterate all attributes of an object.}

  create an attribute-iteration-class X;

 for inst = each attribute-iteration-class do 
   for attribute-name = each symbol that is a user-defined attribute name of inst do
            if attribute-name is temperature 
            and the value that is an attribute of inst named by attribute-name = 2.7
            then successes = successes + 1;
            if attribute-name is color
            and the value that is an attribute of inst named by attribute-name is green
