array-12-test (node: class benchmark-node)
ary: class quantity-array;
sym: symbol;
txt: text;
num-of-aborts: quantity = 0;

begin
   {Test limits of indexing.}

   create a quantity-array ary;
   change the array-length of ary to 18;

   begin
      change ary[18] = -1;  {17 is max index}
   end on error (sym, txt)
       num-of-aborts = num-of-aborts + 1;
   end;

   begin
      change ary[3] = ary[18];
   end on error (sym, txt)
       num-of-aborts = num-of-aborts + 2;
   end; 

   change the array-length of ary to 17;
   begin
      change ary[17] = 12;  {now 16 is max index}
   end on error (sym, txt)
       num-of-aborts = num-of-aborts + 4;
   end; 

   change the array-length of ary to 0;
   begin
      change ary[0] = 12;  {now no index is legal}
   end on error (sym, txt)
       num-of-aborts = num-of-aborts + 8;
   end; 

   {Max is 2^19 - 2^10}
    {FOLLOWING COMMENTED FOR EXPEDIENCY IN RUNNING TESTS.  UNCOMMENT TO RUN AS STRESS TEST.}
   {change the array-length of ary to 523264;}{legal}

   begin
      change the array-length of ary to 523265; {> limit}
   end on error (sym, txt)
       num-of-aborts = num-of-aborts + 16;
   end; 

   if num-of-aborts = 1 + 2 + 4 + 8 + 16
   then call pass (node)
   else call fail (node, "array limit check failed. [num-of-aborts]");

   delete ary;
end

